import React from "react";
import BookDetail from "./bookDetail";



const Books = ({ books }) => {
  console.log("Books");
  
  return (
          books.map((book, index) => (
            <BookDetail key={`${index}-${book.volumeInfo.title}`} book={book} />
          ))  
  );
};


export default Books;
